- 1 pk ranch dressing mix 
- 1 lb. sausage (cooked and crumbled) 
- 1 (8oz.) cream cheese, (I used the whipped cream cheese) 
- 1 (8oz.) bag real bacon pieces 
- 1 1/2 cups shredded cheddar cheese 
- 2 tsp milk
- 2 (13.8 oz.) tues of pizza crust 
- 2 baking sheets 

Directions: 
1. Preheat oven to 425¬∞F. Line baking sheets with parchment paper and set aside. 
2. In a large mixing bowl, mix together the first 6 ingredients. 
3. Unroll pizza crusts and top evenly with cream cheese mixture, make sure ingredients are spread evenly across pizza crusts. Roll up pizza crust long side to long side. 
4. Score the rolls evenly 27 times, before cuttting into slices, yielding 28 pinwheels.
5. Place on baking sheet and bake 13-15 minutes depending on your oven or until golden
